import {Link} from 'react-router-dom';
export default function Heading() {
    return (
        <header>
            <article className="call-to-action">
                <section className="hero-text">
                    <h1>Little Lemon Restaurant</h1>
                    <h2>Islamabad</h2>
                    <p className="subsection">Little Lemon restaurant in Islamabad is a vibrant and cozy eatery that offers a diverse menu of delectable dishes. With its warm ambiance, friendly staff, and mouth-watering food, Little Lemon is a must-visit spot for foodies in the city..</p>
                    <br></br>
                    <Link className="action-button" to="/reservations">Reserve Now</Link>
                </section>

                <section className="hero-image">
                    <img src={require('../../../assets/food/food1.jpg')} alt="Little Lemon restaurant cuisine"></img>
                </section>
            </article>
      </header>
    );
}
